INSERT INTO `goals` (`id`, `goal`, `program_id`, `created_at`, `updated_at`) VALUES
(1, 'دمج حلول تكنولوجيا المعلومات والعمليات التجارية لتلبية احتياجات المعلومات للشركات والمؤسسات ، وتمكينها من تحقيق أهدافها بطريقة كفئة وفعالة.', 1, '2024-07-30 07:26:33', '2024-07-30 08:20:20'),
(2, 'إدارة واستغلال البيانات والمعلومات التنظيمية وتصميم نماذج البيانات والمعلومات.', 1, '2024-07-30 07:27:01', '2024-07-30 08:20:31'),
(3, 'إدارة موارد ومشاريع تطوير نظم المعلومات وتنفيذ الحلول، بما في ذلك استخدام لغات البرمجة المناسبة والأنظمة والأدوات المستندة إلى الويب ومنهجيات التصميم وأنظمة قواعد البيانات.', 1, '2024-07-30 07:27:22', '2024-07-30 08:20:43'),
(5, 'مساعدة الخريجين علي فهم عملية التكامل وتطبيق المهارات في مجال التمويل', 2, '2024-08-03 05:58:16', '2024-08-03 06:01:26'),
(6, 'إعداد وتأهيل كوادر مهنية متخصصة في الادارة المالية لتلبية الطلب المتزايد في مختلف أجهزة الدولة.', 2, '2024-08-03 05:59:23', '2024-08-03 06:01:12'),
(7, 'تقديم خدمة تعليمية متنوعة ومتطورة.', 2, '2024-08-03 06:00:31', '2024-08-03 06:01:04'),
(8, 'تزويد الطالب بالمعارف العلمية والنظرية التي تمكنه من التعرف علي البيانات والقوائم المالية لنتائج الاعمال.', 2, '2024-08-03 06:00:56', '2024-08-03 06:00:56'),
(9, 'تنمية قدرات الطالب للقيام بالتحليل المالي لتحديد مدى قدرة المنشأه علي مواجهة التزاماتها', 2, '2024-08-03 06:01:46', '2024-08-03 06:01:46'),
(10, 'إعداد الطلاب مهنياً ليكونوا قادرين علي المنافسه بتميز في سوق العمل.', 2, '2024-08-03 06:02:05', '2024-08-03 06:02:12'),
(11, 'توفير فرص للتطبيق العملي من خلال التدريب وانشاء العديد من البروتوكولات مع المؤسسات المختلفة للتوظيف ودخول سوق العمل.', 2, '2024-08-03 06:02:34', '2024-08-03 06:02:34'),
(12, 'تنمية المبادئ والاعتبارات الأخلاقية لدى الطلبة وتعزيز ثقافة الجودة والمسؤولية الاجتماعية.', 2, '2024-08-03 06:02:53', '2024-08-03 06:02:53'),
(13, 'فهم وتقييم الأسواق والمؤسسات المالية وحل القضايا المالية الأخلاقية وإظهار الأخلاقيات المهنية في تنفيذ اللوائح المالية', 2, '2024-08-03 06:03:13', '2024-08-03 06:03:13'),
(14, 'فهم الإدارة المالية الدولية والمخاطر المرتبطة بالعمليات العالمية من أجل تطبيق أدوات مختلفة لإدارة مخاطر سعر الصرف وعيوب السوق مع تعظيم فوائد التوسع في الأسواق العالمية.', 2, '2024-08-03 06:03:41', '2024-08-03 06:03:41'),
(15, 'تنمية القدرة على البحث عن الأدلة ووجهات النظر حول المواضيع المتعلقة بالتمويل، تحليل احتمالات السيناريوهات المختلفة والمواقف التنافسية.', 2, '2024-08-03 06:04:19', '2024-08-03 06:04:19'),
(16, 'تنمية القدرة على البحث عن الأدلة ووجهات النظر حول المواضيع المتعلقة بالتمويل، تحليل احتمالات السيناريوهات المختلفة والمواقف التنافسية.', 2, '2024-08-03 06:04:39', '2024-08-03 06:04:39');
