INSERT INTO `knowledge` (`id`, `name`, `program_id`, `created_at`, `updated_at`) VALUES
(1, 'جوهر التحليل والجبر والرياضيات التطبيقية والإحصاء.', 1, '2024-07-30 07:28:26', '2024-07-30 07:28:26'),
(2, 'نظم المعلومات، إدارة البيانات والمعلومات، البنية المؤسسية، إدارة مشاريع نظم المعلومات، البنية التحتية لتكنولوجيا المعلومات، تحليل وتصميم النظم، واستراتيجيات نظم المعلومات.', 1, '2024-07-30 07:28:44', '2024-07-30 07:28:44'),
(3, 'مبادئ وتقنيات نظم إدارة قواعد البيانات، الإدارة، استخراج البيانات، نظم المعلومات الجغرافية، الوسائط المتعددة، تطوير التطبيقات، إدارة العمليات التجارية، أنظمة المؤسسات،', 1, '2024-07-30 07:29:01', '2024-07-30 07:29:01'),
(4, 'التفاعل بين الإنسان والحاسوب، التحليل والتصميم الموجه للكائنات، التقنيات الإلكترونية، الوسائط المتعددة، الصورة تقنيات المعالجة وأمن المعلومات والبنى التحتية وتقنيات الرسومات الحاسوبية.', 1, '2024-07-30 07:29:19', '2024-07-30 07:29:19'),
(5, 'قضايا مثل الجودة والموثوقية والمؤسسات وقانون العمل والمحاسبة والصحة.', 1, '2024-07-30 07:29:34', '2024-07-30 07:29:34'),
(6, 'الوعي بالجوانب التنظيمية والبشرية والاقتصادية للمنظمات الحديثة.', 1, '2024-07-30 07:29:48', '2024-07-30 07:29:48'),
(7, 'مبادئ اتصالات المعلومات وأمن المعلومات.', 1, '2024-07-30 07:30:02', '2024-07-30 07:30:02'),
(8, 'مواصفات وتحليل وتصميم وتنفيذ وتشغيل وصيانة حلول نظم المعلومات.', 1, '2024-07-30 07:30:19', '2024-07-30 07:30:19'),
(9, 'نمذجة العمليات والبيانات التنظيمية، وتحديد وتنفيذ الحلول التقنية والعملياتية، وإدارة المشاريع، وتكامل الأنظمة.', 1, '2024-07-30 07:30:36', '2024-07-30 07:30:36'),
(10, 'أنواع وبدائل هياكل نظم المعلومات العالمية، واختلافاتها من حيث عواقب الخدمة والتكلفة، وانعكاساتها على الدعم التنظيمي المطلوب.', 1, '2024-07-30 07:30:49', '2024-07-30 07:30:49'),
(11, 'الحصول على فهم تفصيلي لأساسيات برمجة الكمبيوتر والشبكات وتنظيم الكمبيوتر وهندسة الكمبيوتر والشبكات والذكاء الاصطناعي والرسومات وواجهات الكمبيوتر وقواعد البيانات والتطبيقات المدمجة وأمن الكمبيوتر والشبكات وأنظمة التشغيل.', 1, '2024-07-30 07:31:03', '2024-07-30 07:31:03'),
(13, 'الأشـكال والأنـواع المختلفـة لمؤسسـات الأعمـال والسـمات المميـزة لكـل منها.', 2, '2024-08-03 06:11:18', '2024-08-03 06:11:18'),
(14, 'البيئات المختلفة التي تعمل فيها المنظمات وأساليب التعامل معها.', 2, '2024-08-03 06:11:46', '2024-08-03 06:11:46'),
(15, 'التطـوارت والاتجاهـات الحديثـة والقضـايا المعاصـرة المرتبطـة بمجال التخصص.', 2, '2024-08-03 06:12:14', '2024-08-03 06:12:14'),
(16, 'المبـادئ الأساسـية والنظريـات والاتجاهـات والمـدارس الفكريـة في مجـال التخصص', 2, '2024-08-03 06:12:36', '2024-08-03 06:12:36'),
(17, 'العلوم وثيقة الصلة بالتخصص الذي يدرسه الطالب.', 2, '2024-08-03 06:12:50', '2024-08-03 06:12:50'),
(18, 'مناهج البحث العلمي وأدواته وأساليب القياس والتحليل', 2, '2024-08-03 06:13:07', '2024-08-03 06:13:07'),
(19, 'التكامل بين العلوم التجارية وغيرها من العلوم الاجتماعية.', 2, '2024-08-03 06:18:55', '2024-08-03 06:18:55'),
(20, 'أخلاقيات الأعمال والممارسة المهنية في مجال التخصص.', 2, '2024-08-03 06:19:11', '2024-08-03 06:19:11'),
(21, 'إسـتخدام المـنهج العلمي في حـل المشـكلات واتخـاذ القرارات في المستويات الإدارية المختلفة.', 2, '2024-08-03 06:19:42', '2024-08-03 06:19:56'),
(22, 'أسس إعداد الخطط والبرامج والسياسات وفقاً لمتطلبات المؤسسات.', 2, '2024-08-03 06:20:27', '2024-08-03 06:20:27'),
(23, 'أسس إعداد دراسات الجدوى التسويقية وتقييم مقترحات الاستثمار.', 2, '2024-08-03 06:20:57', '2024-08-03 06:20:57'),
(24, 'أسـس تصـميم الهياكـل التنظيميـة ونظـم وأدلـة العمـل الإداريـة للأنشـطة المختلفة بالمؤسسة.', 2, '2024-08-03 06:21:20', '2024-08-03 06:21:20'),
(25, 'اسـتيعاب الفلسـفات الإداريـة الحديثـة مثـل الجـودة الشـاملة  واعادة هندسـة العمليات واستكشاف فرص تطبيقها في مجالات العمل المختلفة.', 2, '2024-08-03 06:53:04', '2024-08-03 06:53:04'),
(26, 'مبادئ القيادة والتأثير في الآخرين.', 2, '2024-08-03 06:53:33', '2024-08-03 06:53:33'),
(27, 'الاتصالات التنظيمية وعلاقات العمل', 2, '2024-08-03 06:53:52', '2024-08-03 06:53:52'),
(28, 'أسس التحفيز وتنمية الدافعية لدى الأخرين.', 2, '2024-08-03 06:54:21', '2024-08-03 06:54:21'),
(29, 'أسـس ومفـاهيم السياسـات والاسـتراتيجيات والخطـط ومتطلبـات اسـتخدامها لتلبية توقعات الأطراف ذوى العلاقة بالمنظمة.', 2, '2024-08-03 06:55:08', '2024-08-03 06:55:08');
