(2, 'التحليل والاستنتاج واتباع المنهج العلمي في التفكير.', 2, '2024-08-03 06:05:18', '2024-08-03 06:05:18'),
(3, 'تطبيق أسس ومبادئ التفكير الابتكاري.', 2, '2024-08-03 06:05:40', '2024-08-03 06:05:40'),
(4, 'النقد والتمييز واكتشاف العناصر الإيجابية والسلبية في المسائل والقضايا المطروحة.', 2, '2024-08-03 06:06:05', '2024-08-03 06:06:05'),
(5, 'التعامل مع الأرقام وتحليلها وتفسير مدلولاتها.', 2, '2024-08-03 06:06:22', '2024-08-03 06:06:22'),
(6, 'التعامل الإيجابي مـع المواقـف المختلفـة بمـا يمكـن مـن تحويـل التهديـدات إلي فرص.', 2, '2024-08-03 06:06:41', '2024-08-03 06:06:41'),
(7, 'عـرض الأفكـار ووجهـات النظـر بوضـوح وابداء الـ أري بأسـلوب علمـي مدعم بالأدلة والموضوعية.', 2, '2024-08-03 06:07:16', '2024-08-03 06:07:16'),
(8, 'ممارسـة التفكيـر الابتكاري والإبـداعي فـي مواجهـة المواقـف الإدارية المختلفة.', 2, '2024-08-03 06:07:43', '2024-08-03 06:07:43'),
(9, 'الربط بين المتغيرات البيئية وأنماط اتخاذ القرارات.', 2, '2024-08-03 06:08:40', '2024-08-03 06:08:40'),
(10, 'إعـداد السـيناريوهات والاسـتراتيجيات والنمـاذج المختلفـة للتعامـل مـع الأحداث والقضايا الإدارية.', 2, '2024-08-03 06:09:29', '2024-08-03 06:09:29'),
(11, 'إعـداد السـيناريوهات والاسـتراتيجيات والنمـاذج المختلفـة للتعامـل مـع الأحداث والقضايا الإدارية.', 2, '2024-08-03 06:09:29', '2024-08-03 06:09:29'),
(12, 'تحديد مشاكل نظم المعلومات التقليدية وغير التقليدية، ووضع الأهداف لحلها. مراقبة النتائج', 1, '2024-08-03 09:51:23', '2024-08-03 09:51:23'),
(13, 'إجراء المقارنات بين (الطرق، التقنيات...الخ).', 1, '2024-08-03 09:51:37', '2024-08-03 09:51:37'),
(14, 'التعرف على السمات والمكونات والعلاقات والأنماط والأفكار الرئيسية والأخطاء', 1, '2024-08-03 09:51:49', '2024-08-03 09:51:49'),
(15, 'تقييد منهجيات الحل على نتائجها', 1, '2024-08-03 09:51:59', '2024-08-03 09:51:59'),
(16, 'اختيار الأدوات والأساليب والتقنيات المناسبة للنمذجة وتحليل نظم المعلومات ووضع المعايير والتحقق من الحلول', 1, '2024-08-03 09:52:13', '2024-08-03 09:52:13'),
(17, 'تحديد مجموعة من الحلول وإجراء تقييم نقدي وتبرير حلول التصميم المقترحة', 1, '2024-08-03 09:52:25', '2024-08-03 09:52:25'),
(18, 'حل مشاكل نظم المعلومات مع القيود التجارية والزمنية والصناعية الملحة', 1, '2024-08-03 09:52:40', '2024-08-03 09:52:40'),
(19, 'اقتراح تصميم مبتكر لحل مشكلة تحتوي على مجموعة من المعوقات التجارية والصناعية', 1, '2024-08-03 09:52:50', '2024-08-03 09:52:50'),
(20, '. إجراء تحليل المشكلة من خلال الأوصاف المكتوبة؛ استخلاص مواصفات المتطلبات من فهم المشكلات (التحليل والتركيب).', 1, '2024-08-03 09:53:00', '2024-08-03 09:53:00'),
(21, 'تحديد مشاكل نظم المعلومات التقليدية وغير التقليدية، ووضع الأهداف لحلها. مراقبة النتائج', 1, '2024-08-06 05:37:01', '2024-08-06 05:37:01');
