(13, 'توظيـف المعـارف والمهـارات المكتسـبة في مجـال التخصـص لخدمـة المجتمع والبيئة المحيطة بشكل إيجابي.', 2, '2024-08-03 07:39:49', '2024-08-03 07:39:49'),
(14, 'التواصل والاتصال الفعال بالآخرين', 2, '2024-08-03 07:40:07', '2024-08-03 07:40:07'),
(15, 'التفاعل مع المسـتجدات والمتغيرات العالميـة واستشـراف طبيعـة وتـأثير تلـك المستجدات والمتغيارت على مجال تخصصه.', 2, '2024-08-03 07:41:07', '2024-08-03 07:41:07'),
(16, 'التعرف على المشكلات القابلة لنظم المعلومات الحاسوبية، ومعرفة الأدوات اللازمة لحل تلك المشكلات.', 1, '2024-08-06 04:53:54', '2024-08-06 04:53:54'),
(17, 'فهم أساسيات دورة حياة تطوير الأنظمة (SDLC)، وشبكات المعلومات، وأمن المعلومات، واستخراج البيانات، والتجارة الإلكترونية، ونظم المعلومات الجغرافية، وإدارة الأزمات.', 1, '2024-08-06 04:54:33', '2024-08-06 04:54:33'),
(18, 'إدارة واستغلال البيانات والمعلومات التنظيمية. تصميم نماذج البيانات والمعلومات، إدارة موارد ومشاريع تطوير نظم المعلومات.', 1, '2024-08-06 04:54:52', '2024-08-06 04:54:52'),
(19, 'تنفيذ الحلول، بما في ذلك استخدام لغات البرمجة المناسبة والأنظمة والأدوات المستندة إلى الويب ومنهجيات التصميم وأنظمة قواعد البيانات.', 1, '2024-08-06 04:55:08', '2024-08-06 04:55:08'),
(20, 'تطبيق مبادئ الإدارة الفعالة للمعلومات، وتنظيم المعلومات، واستخراج المعلومات، ومهارات استرجاع المعلومات على المعلومات بمختلف أنواعها، بما في ذلك النصوص والصور والصوت والفيديو.', 1, '2024-08-06 04:55:27', '2024-08-06 04:55:27'),
(21, 'معرفة أساسيات تقنيات نظم المعلومات الذكية.', 1, '2024-08-06 04:55:38', '2024-08-06 04:55:38'),
(22, 'تحديد وتصميم وتنفيذ أنظمة المعلومات المعتمدة على الكمبيوتر، وتقييمها من حيث سمات الجودة العامة والمفاضلات المحتملة المقدمة ضمن المشكلة المحددة.', 1, '2024-08-06 04:55:58', '2024-08-06 04:55:58'),
(23, 'تطبيق حلول نظم المعلومات على المشاكل والفرص الوظيفية والمشتركة بين المنظمات والتشغيلية والإدارية والتنفيذية.', 1, '2024-08-06 04:56:20', '2024-08-06 04:56:20'),
(24, 'وصف خصائص المكونات المختلفة لنظم المعلومات، واستخدام الأدوات والتقنيات المناسبة لتحليل وتصميم وبناء نظم المعلومات.', 1, '2024-08-06 04:56:41', '2024-08-06 04:56:41'),
(25, 'التواصل بفعالية بالوسائل الشفهية والمكتوبة والمرئية.', 1, '2024-08-06 04:57:01', '2024-08-06 04:57:01'),
(26, 'العمل بفعالية كفرد وكعضو في فريق.', 1, '2024-08-06 04:57:14', '2024-08-06 04:57:14'),
(27, 'إدارة الوقت بشكل مستقل وفعال.', 1, '2024-08-06 04:57:26', '2024-08-06 04:57:26'),
(28, 'إدراك القضايا الأخلاقية الرئيسية التي تؤثر على نظم المعلومات ومسؤولياتهم كمحترفين في علم المعلومات.', 1, '2024-08-06 04:57:44', '2024-08-06 04:57:44'),
(29, 'التعرف على المشكلات القابلة لنظم المعلومات الحاسوبية، ومعرفة الأدوات اللازمة لحل تلك المشكلات.', 1, '2024-08-06 05:56:44', '2024-08-06 05:56:44');
