(13, 'التعرف على السمات والمكونات والعلاقات والأنماط والأفكار الرئيسية والأخطاء', 1, '2024-08-06 05:37:38', '2024-08-06 05:37:38'),
(14, 'تحديد مشاكل نظم المعلومات التقليدية وغير التقليدية، ووضع الأهداف لحلها. مراقبة النتائج', 1, '2024-08-06 05:38:08', '2024-08-06 05:38:08'),
