(16, 'اختيار الأدوات والأساليب والتقنيات المناسبة للنمذجة وتحليل نظم المعلومات ووضع المعايير والتحقق من الحلول', 1, '2024-08-06 05:39:10', '2024-08-06 05:39:10'),
(17, 'تحديد مجموعة من الحلول وإجراء تقييم نقدي وتبرير حلول التصميم المقترحة', 1, '2024-08-06 05:39:29', '2024-08-06 05:39:29'),
(18, 'حل مشاكل نظم المعلومات مع القيود التجارية والزمنية والصناعية الملحة', 1, '2024-08-06 05:39:46', '2024-08-06 05:39:46'),
(19, 'حل مشاكل نظم المعلومات مع القيود التجارية والزمنية والصناعية الملحة', 1, '2024-08-06 05:40:06', '2024-08-06 05:40:06'),
(20, '. إجراء تحليل المشكلة من خلال الأوصاف المكتوبة؛ استخلاص مواصفات المتطلبات من فهم المشكلات (التحليل والتركيب).', 1, '2024-08-06 05:40:28', '2024-08-06 05:40:28'),
(21, 'تحديد مشاكل نظم المعلومات التقليدية وغير التقليدية، ووضع الأهداف لحلها. مراقبة النتائج', 1, '2024-08-06 05:40:50', '2024-08-06 05:40:50'),
(22, 'جوهر التحليل والجبر والرياضيات التطبيقية والإحصاء.', 1, '2024-08-06 05:41:06', '2024-08-06 05:41:06'),
(23, 'نظم المعلومات، إدارة البيانات والمعلومات، البنية المؤسسية، إدارة مشاريع نظم المعلومات، البنية التحتية لتكنولوجيا المعلومات، تحليل وتصميم النظم، واستراتيجيات نظم المعلومات.', 1, '2024-08-06 05:41:41', '2024-08-06 05:41:41'),
(24, 'مبادئ وتقنيات نظم إدارة قواعد البيانات، الإدارة، استخراج البيانات، نظم المعلومات الجغرافية، الوسائط المتعددة، تطوير التطبيقات، إدارة العمليات التجارية، أنظمة المؤسسات،', 1, '2024-08-06 05:41:54', '2024-08-06 05:41:54'),
(25, 'التفاعل بين الإنسان والحاسوب، التحليل والتصميم الموجه للكائنات، التقنيات الإلكترونية، الوسائط المتعددة، الصورة تقنيات المعالجة وأمن المعلومات والبنى التحتية وتقنيات الرسومات الحاسوبية.', 1, '2024-08-06 05:42:14', '2024-08-06 05:42:14'),
(26, 'قضايا مثل الجودة والموثوقية والمؤسسات وقانون العمل والمحاسبة والصحة.', 1, '2024-08-06 05:42:32', '2024-08-06 05:42:32'),
(27, 'الوعي بالجوانب التنظيمية والبشرية والاقتصادية للمنظمات الحديثة.', 1, '2024-08-06 05:42:48', '2024-08-06 05:42:48'),
(28, 'مبادئ اتصالات المعلومات وأمن المعلومات.', 1, '2024-08-06 05:43:30', '2024-08-06 05:43:30'),
(29, 'مواصفات وتحليل وتصميم وتنفيذ وتشغيل وصيانة حلول نظم المعلومات.', 1, '2024-08-06 05:43:49', '2024-08-06 05:43:49'),
(30, 'نمذجة العمليات والبيانات التنظيمية، وتحديد وتنفيذ الحلول التقنية والعملياتية، وإدارة المشاريع، وتكامل الأنظمة.', 1, '2024-08-06 05:44:11', '2024-08-06 05:44:11'),
(31, 'أنواع وبدائل هياكل نظم المعلومات العالمية، واختلافاتها من حيث عواقب الخدمة والتكلفة، وانعكاساتها على الدعم التنظيمي المطلوب.', 1, '2024-08-06 05:44:40', '2024-08-06 05:44:40'),
(32, 'الحصول على فهم تفصيلي لأساسيات برمجة الكمبيوتر والشبكات وتنظيم الكمبيوتر وهندسة الكمبيوتر والشبكات والذكاء الاصطناعي والرسومات وواجهات الكمبيوتر وقواعد البيانات والتطبيقات المدمجة وأمن الكمبيوتر والشبكات وأنظمة التشغيل.', 1, '2024-08-06 05:45:00', '2024-08-06 05:45:00'),
(33, 'استخدام لغات البرمجة المناسبة، وأنظمة وأدوات الويب، ومنهجيات التصميم، وأنظمة قواعد البيانات.', 1, '2024-08-06 05:45:19', '2024-08-06 05:45:19'),
(34, 'استخدام تقنيات التحليل الكمي بشكل مناسب', 1, '2024-08-06 05:48:40', '2024-08-06 05:48:40'),
(35, 'استخدام تقنيات التحليل الكمي بشكل مناسب', 1, '2024-08-06 05:48:56', '2024-08-06 05:48:56'),
(36, 'تبرير الخيارات التكنولوجية والمنهجية والإدارية لمشروع نظام معلومات لمنظمة معينة', 1, '2024-08-06 05:53:21', '2024-08-06 05:53:21'),
(37, 'تخطيط وإدارة مشروع نظم المعلومات من البداية إلى التنفيذ النهائي والنهائي', 1, '2024-08-06 05:53:34', '2024-08-06 05:53:34'),
(38, 'إجراء عملية الحصول على المعلومات وإدارتها باستخدام المؤلفات العلمية ومصادر الويب.', 1, '2024-08-06 05:53:55', '2024-08-06 05:53:55'),
(39, 'تطبيق مبادئ الحصول الفعال على المعلومات، وإدارة المعلومات، وتنظيمها، واسترجاع المعلومات على النصوص والصور والصوت والفيديو', 1, '2024-08-06 05:54:23', '2024-08-06 05:54:23'),
(40, 'تطبيق مبادئ التفاعل بين الإنسان والحاسوب على تقييم وبناء مجموعة واسعة من المواد بما في ذلك واجهات المستخدم وصفحات الويب وأنظمة الوسائط المتعددة', 1, '2024-08-06 05:54:59', '2024-08-06 05:54:59'),
(41, 'استخدام الأدوات اللازمة لأتمتة مراحل تطوير نظم المعلومات', 1, '2024-08-06 05:55:20', '2024-08-06 05:55:20'),
(42, 'تحليل وتوثيق جدوى الخيارات المختلفة ومقارنة خيارات الحلول', 1, '2024-08-06 05:55:41', '2024-08-06 05:55:41'),
(43, 'الحفاظ على نظم المعلومات القائمة', 1, '2024-08-06 05:56:07', '2024-08-06 05:56:07'),
(44, 'فهم أساسيات دورة حياة تطوير الأنظمة (SDLC)، وشبكات المعلومات، وأمن المعلومات، واستخراج البيانات، والتجارة الإلكترونية، ونظم المعلومات الجغرافية، وإدارة الأزمات.', 1, '2024-08-06 05:57:05', '2024-08-06 05:57:05'),
(45, 'إدارة واستغلال البيانات والمعلومات التنظيمية. تصميم نماذج البيانات والمعلومات، إدارة موارد ومشاريع تطوير نظم المعلومات', 1, '2024-08-06 05:57:17', '2024-08-06 05:57:17'),
(46, 'تنفيذ الحلول، بما في ذلك استخدام لغات البرمجة المناسبة والأنظمة والأدوات المستندة إلى الويب ومنهجيات التصميم وأنظمة قواعد البيانات.', 1, '2024-08-06 05:57:30', '2024-08-06 05:57:30'),
(47, 'تطبيق مبادئ الإدارة الفعالة للمعلومات، وتنظيم المعلومات، واستخراج المعلومات، ومهارات استرجاع المعلومات على المعلومات بمختلف أنواعها، بما في ذلك النصوص والصور والصوت والفيديو.', 1, '2024-08-06 05:59:41', '2024-08-06 05:59:41'),
(48, 'معرفة أساسيات تقنيات نظم المعلومات الذكية.', 1, '2024-08-06 05:59:52', '2024-08-06 05:59:52'),
(49, 'تحديد وتصميم وتنفيذ أنظمة المعلومات المعتمدة على الكمبيوتر، وتقييمها من حيث سمات الجودة العامة والمفاضلات المحتملة المقدمة ضمن المشكلة المحددة.', 1, '2024-08-06 06:00:09', '2024-08-06 06:00:09'),
(50, 'وصف خصائص المكونات المختلفة لنظم المعلومات، واستخدام الأدوات والتقنيات المناسبة لتحليل وتصميم وبناء نظم المعلومات.', 1, '2024-08-06 06:02:17', '2024-08-06 06:02:17'),
(51, 'تطبيق حلول نظم المعلومات على المشاكل والفرص الوظيفية والمشتركة بين المنظمات والتشغيلية والإدارية والتنفيذية.', 1, '2024-08-06 06:02:44', '2024-08-06 06:02:44'),
(52, 'التواصل بفعالية بالوسائل الشفهية والمكتوبة والمرئية.', 1, '2024-08-06 06:03:29', '2024-08-06 06:03:29'),
(53, 'العمل بفعالية كفرد وكعضو في فريق.', 1, '2024-08-06 06:03:41', '2024-08-06 06:03:41'),
(54, 'إدارة الوقت بشكل مستقل وفعال.', 1, '2024-08-06 06:03:52', '2024-08-06 06:03:52'),
(55, 'إدراك القضايا الأخلاقية الرئيسية التي تؤثر على نظم المعلومات ومسؤولياتهم كمحترفين في علم المعلومات.', 1, '2024-08-06 06:04:12', '2024-08-06 06:04:12');
